import data from './data';
function App() {
  return (
    <div>
      <header>
        <a href="/">eStore for Books</a>
      </header>
      <main>
        <h1>featured Products</h1>
        <div>
        {data.books.map((book) => (
          <div key={book.id}>
            <img src={book.image} alt={book.name} />
            <p>{book.name}</p>
            <p>{book.price}</p>
          </div>
        ))}
        </div>
      </main>
    </div>
  );
}

export default App;
